import React from 'react';
import Card from './Cards' ;
import Sdata from './Sdata' ;

const favSeries = "netflix" ;

const FavS = () =>{
if ( favSeries === "netflix" ){
  return (
    <Card 
    key = {Sdata[1].id}
    imgSrc = {Sdata[1].imgSrc}
    title =  {Sdata[1].title}
    sname =  {Sdata[1].sname}
    link =   {Sdata[1].link}
    />
  );
}else{

}

};

const App = () =>(      
  <>
    <h1 className = 'heading_style'> List of top 3 Netflix movies in 2k23</h1>
    

  </>
  
);

export default App ;
